import React from 'react';
import Header from "./components/header";
import Footer from "./components/footer";
import NavBar from "./components/navbar";
import About from "./pages/about";
import Shop from "./pages/shop";
import Certificate from "./pages/certificate";
import Cart from "./pages/cart";
import { Routes, BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <NavBar/>
      <div className="content">
       <Router>
        <Routes>
          <Route key="about" path="/about" exact component={About}/>
          <Route key="shop" exact path="/shop" component={Shop}/>
          <Route key="certificate" exact path="/certificate" component={Certificate}/>
          <Route key="cart" exact path="/cart" component={Cart}/>
        </Routes>
        </Router>
      </div>
      <Footer />
    </div>
  );
}

export default App;
